import { Card, Typography, } from "@material-tailwind/react";

import { StarIcon } from "@heroicons/react/24/solid";

const TABLE_HEAD = ["Name", "Price", "Rating", "Commpany",""];
 
const TABLE_ROWS = [
  {
    name: "Iphone 14",
    price: " ₹",
    rating: "4.5",
    company:"Amazon",
  },
  {
    name: "Cycle black color",
    price: " ₹",
    rating: "4.5",
    company:"Amazon",
  },
  {
    name: "Redmi Note 9A",
    price: " ₹",
    rating: "4.5",
    company:"Amazon",
  },
  {
    name: "One plus Nord",
    price: " ₹",
    rating: "4.5",
    company:"Amazon",
  },
  {
    name: "Jeans",
    price: " ₹",
    rating: "4.5",
    company:"Amazon",
  },
];

export function TableWithStripedColumns() {
  return (
    <Card className="mt-10 px-8 h-full w-full overflow-scroll">
      <table className="w-full min-w-max table-auto text-left">
        <thead>
          <tr>
            {TABLE_HEAD.map((head) => (
              <th key={head} className="border-b border-blue-gray-100 bg-blue-gray-50 p-4">
                <Typography
                  variant="small"
                  color="blue-gray"
                  className="font-normal leading-none opacity-70"
                >
                  {head}
                </Typography>
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {TABLE_ROWS.map(({ name, price, rating, company }, index) => {
            const isLast = index === TABLE_ROWS.length - 1;
            const classes = isLast ? "p-4" : "p-4 border-b border-blue-gray-50";
 
            return (
              <tr key={name}>
                <td className={classes}>
                  <Typography variant="small" color="blue-gray" className="font-normal">
                    {name}
                  </Typography>
                </td>
                <td className={`${classes} bg-blue-gray-50/50`}>
                <span className="text-green-500 text-lg mr-1">₹</span>
                  <Typography variant="small" color="blue-gray" className="font-normal">
                    {price}
                  </Typography>
                </td>
                <td className={classes}>
                <div className="flex items-center">
    <Typography variant="small" color="blue-gray" className="font-normal">
      {rating} / 5 
    </Typography>
    <StarIcon className="w-5 h-5 ml-1.5 text-yellow-500 mr-1" />
  </div>
                </td>
                <td className={classes}>
                  <Typography variant="small" color="blue-gray" className="font-normal">
                    {company}
                  </Typography>
                </td>
                <td className={`${classes} bg-blue-gray-50/50`}>
                  <Typography as="a" href="#" variant="small" color="blue-gray" className="font-medium">
                    Edit
                  </Typography>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </Card>
  );
}
